import React from "react";
import Link from "next/link";

import "isomorphic-fetch";

const Home = ({ repositories }) => (
  <div>
    <Link href="/blog">
      <a>BLOG</a>
    </Link>
    {repositories.map(repo => (
      <h1>{repo.name}</h1>
    ))}
  </div>
);

